import Header from "./components/Header";
import React from 'react'
import { Routes, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">

      <header className="App-header">
        <Header />
      </header>

      <Routes>
        <Route exact path='/'>
          <h1>Home</h1>
        </Route>
      </Routes>

    </div>
  );
}

export default App;
